import "./form.css";

interface formData {
    form: any
}

const Form = ({form}: formData) => {

    const splitForm = form.split('');


    const seperatedForm = splitForm.map((item: string, index: number) => {

        switch (item) {
            case 'W':
                return <div className="form-win"><td key={index} className="form-win">W</td></div>;
            case 'D': 
                return <div className="form-win"><td key={index} className="form-draw">D</td></div>;
            case 'L': 
               return <div className="form-win"><td key={index} className="form-loss">L</td></div>;
    
        }
    });

    return( 
        <>{seperatedForm}</>
    );
}

export default Form;
